    //     };
    // sendEmail()

    }

return (
    <>
    <div className="full-block">
        <div class="block-1">
            <div className="projects-1st-column">
                <div className="box-white-text">
                    &#9660; contacts
                </div>
                <div className="box-white-text">
                    <div>
                    trng.dt1@gmail.com
                    </div>
                    <div>
                    +34 632486338
                    </div>
                </div>
                <div className="box-white-text">
                    &#9660; find-me-also-in
